import React from "react";
import Header from "./Header";
import Note from "./Note";
import Footer from "./Footer";
import celebrity from "../celebrity.js";
import Avatar from "./Avatar";

function appContent() {

  return ( < div > < Header / > < body > < h1 className = "heading" > My Contacts < /h1><Avatar image="https:/ / i.pinimg.com / 564 x / 51 / 3 a / 1 d / 513 a1dfe08b9ca63c05433e82ad90d76.jpg " /> <
    Note name = {
      celebrity[0].name
    }
    image = {
      celebrity[0].image
    }
    tel = {
      celebrity[0].tel
    }
    email = {
      celebrity[0].email
    }
    / > <
    Note name = {
      celebrity[1].name
    }
    image = {
      celebrity[1].image
    }
    tel = {
      celebrity[1].tel
    }
    email = {
      celebrity[1].email
    }
    / > <
    Note name = {
      celebrity[2].name
    }
    image = {
      celebrity[2].image
    }
    tel = {
      celebrity[2].tel
    }
    email = {
      celebrity[2].email
    }
    / ></body > <
    Footer / > < /div>);
  }

  export default appContent;
